import "./Tracks.css";

function Tracks() {
  return (
    <div className="container">
      <h1 className="text-white text-7xl mb-auto">Domains/Tracks</h1>
      <div className="w-313 h-254 bg-gradient-to-r from-ffffff to-a583ce"></div>
    </div>
  );
}
export default Tracks;
